import React from "react";
import {
  Table,
  TableBody,
  TableHead,
  
   
  
} from "@material-ui/core";

const row = (x, i, header) =>
  <tr key={`tr-${i}`}>
    {header.map((y, k) =>
      <td key={`trc-${k}`}>
        {x[y.prop]}
      </td>
    )}
  </tr>;

export default ({ data, header }) =>
  <Table>
    <TableHead>
      <tr>
        {header.map((x, i) =>
          <td key={`thc-${i}`}>
            {x.name}
          </td>
        )}
      </tr>
    </TableHead>
    <TableBody>
      {data.map((x, i) => row(x, i, header))}
    </TableBody>
  </Table>;
